import GridLayout from 'react-grid-layout';
import React, { Component } from "react";
import "./court-case.css";
export default class CourtCase extends Component {
  constructor(props) {
    super(props);
    //Details of the Court Case
    this.state = {
      def_name: "",
      def_addr: "",
      pros_name: "",
      pros_addr: "",
      crime_Type: "",
      crime_date: new Date(),
      crime_loc: "",
      arresting_off_name: "",
      date_arrest: new Date(),
      CIN: "",
      date_hearing: "",
      latest_hearing_date: "",
      dates_of_adjournment: [""],
      reasons: [""],
      name_pres_judge: "",
      start_date: "",
      expected_completion_of_trial: ""
    }
  }
  render() {
    // layout is an array of objects, see the demo for more complete usage
    const layout = [
      { i: '1', x: 0, y: 0, w: 5, h: 2, },
      { i: '2', x: 15, y: 0, w: 6, h: 2, minW: 2, maxW: 4 },
      { i: 'c', x: 4, y: 0, w: 1, h: 2 }
    ];
    return (
      <div className="CourtCase">
        <GridLayout layout={layout} cols={12} rowHeight={30} width={1200}>
          <div key="1">
            <h1>Case : {this.state.CIN}</h1>
            <b>Defendent Name :</b> {this.state.def_name}
            <br />
            <b>Defendent Address :</b> {this.state.def_addr}
            <br /><br />
            <b>Prosecutor Name :</b> {this.state.def_name}
            <br />
            <b>Prosecutor Address :</b> {this.state.def_addr}
            <br /><br />



          </div>
          <div key="2">
            <b>Crime Type :</b>  {this.state.crime_Type}
            <b>Crime Date :</b>  {this.state.crime_date.toISOString()}
          </div>
          <div key="c"></div>
        </GridLayout>
      </div>
    )
  }
}
